import React, { PureComponent } from "react";
import { Outlet, Link } from "react-router-dom";
import "../styles/listing.css";

class Listing extends PureComponent {
  render() {
    let productsAll = this.props.state.productsAll;

    return (
      <>
        {productsAll.map((product) => {
          <div className="listing-container">
            <div className="listing">
              <div className="listing-image">
                {" "}
                <img src={product.gallery[0]} className="listing-image"></img>
              </div>
              <div className="listing-info">
                <div className="listing-title">{product.name}</div>
                <div className="listing-price">{product.prices[0].amount}</div>
              </div>
            </div>
          </div>;
        })}
      </>
    );
  }
}

export default Listing;
